import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import HomeScreen from './screens/HomeScreen';


function App() {
  return (
    <BrowserRouter>
      <Route path="/" component={HomeScreen} exact></Route>
    </BrowserRouter>
  );
}

export default App;
